Joseph Kahn, Director

Kahn has directed a lot of music videos in the past 20 years, including: Rob Zombie in &quot;Living Dead Girl&quot; (1998); Jennifer Love Hewitt with &quot;How Do I Deal&quot; (1999); Britney Spears for &quot;Stronger&quot; (2000), &quot;Toxic&quot; (2004), &quot;Womanizer&quot; (2009), and &quot;Perfume&quot; (2013); Ashlee Simpson in &quot;La La&quot; (2004); Gwen Stefani and &quot;The Sweet Escape&quot; (2006); Lady Gaga in &quot;Eh Eh (Nothing I Can Say)&quot; and &quot;LoveGame&quot; (both 2009); Katy Perry for &quot;Waking Up In Vegas&quot; (2010); and Eminem [ft. Rihanna] in &quot;Love The Way You Lie&quot; (2010).

